import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
// import * as serviceWorker from "./serviceWorker";
import { Toaster } from 'react-hot-toast';

ReactDOM.render(
  <React.StrictMode>
  <Toaster position="top-center">
    <App />
    </Toaster>
  </React.StrictMode>,
  document.getElementById("root")
);

